import React from 'react';
import './AdminPage.css'; // Import the CSS file
import DataTable from 'react-data-table-component';

const columns = [
    {
        name: 'Title',
        selector: row => row.title,
        sortable: true
    },
    {
        name: 'Year',
        selector: row => row.year,
        sortable: true
    },
];

const data = [
    {
        id: 1,
        title: 'Beetlejuice',
        year: '1988',
    },
    {
        id: 2,
        title: 'Ghostbusters',
        year: '1984',
    },
]

function AdminPage() {
  return (
    <div className="admin-page"> {/* Apply the class */}
     <div className='container mt-5'>
     <DataTable
            columns={columns}
            data={data}
            selectableRows
            fixedHeader
            pagination
        />
               <div className='text-end'><input type="text"/></div>

     </div>
    </div>
  );
}

export default AdminPage;
